import Button from "./Button";
import { Fragment } from "react";

export default (props) => {
    return <Fragment>
        {props.field.type === "select" && <Fragment>
            {props.field.options.map(btn => <Button>{btn.text}</Button>)}
        </Fragment>}
    </Fragment>
}
